import styled from 'styled-components'

const StyledSection = styled.section`
  height: 50vw;
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  margin-top: 5vw;
  margin-bottom: 5vw;

  h1 {
    color: var(--wine);
  }
`

export { StyledSection }
